const levels = [
    'error',
    'warn',
    'info',
    'success',
    'debug'
];
const shouldPublishLog = (currentLogLevel, logLevel)=>{
    const normalizedLogLevel = 'success' === logLevel ? 'info' : logLevel;
    const currentLevelIndex = levels.indexOf(currentLogLevel);
    const messageLevelIndex = levels.indexOf(normalizedLogLevel);
    return messageLevelIndex <= currentLevelIndex;
};
export { levels, shouldPublishLog };
